fr:mainmatter.fr:p:
A (strong, compare to weak) factorization system in a category C consists of
two classes of maps L and R so that:

every map admits an (L, R)-factorization;

this factorization is unique up to unique isomorphism;

L and R are closed under composition and contain the isomorphisms.

Let L and R be classes of maps in a category and x\xrightarrow {f} y a map.
Then an (L, R)-factorization of f is a pair x\xrightarrow {l} z\in  L and
z\xrightarrow {r} y\in  R so
that 




